Yes, it is possible to have global variables with the same name in different modules in C. However, these variables are considered separate entities and do not conflict with each other because they are in different scopes. Each global variable is visible only within the file (module) where it is declared, unless explicitly declared as `extern` in another file.

Here's a simple example to illustrate this:

**file1.c:**
```c
#include <stdio.h>

int global_var = 10;  // Global variable in file1.c

void print_global_var() {
    printf("Global variable in file1.c: %d\n", global_var);
}
```

**file2.c:**
```c
#include <stdio.h>

int global_var = 20;  // Global variable in file2.c

void print_global_var() {
    printf("Global variable in file2.c: %d\n", global_var);
}
```

**main.c:**
```c
#include <stdio.h>

void print_global_var_from_file1();
void print_global_var_from_file2();

int main() {
    print_global_var_from_file1();
    print_global_var_from_file2();
    return 0;
}

void print_global_var_from_file1() {
    extern int global_var;  // Declare global_var from file1.c
    print_global_var();     // Call the function from file1.c
}

void print_global_var_from_file2() {
    extern int global_var;  // Declare global_var from file2.c
    print_global_var();     // Call the function from file2.c
}
```

